import React, { useEffect, useState } from 'react'
import axios from 'axios'

const DeleteEquity = () => {
    const [id, setId] = useState(0)

    const [msg, setMsg] = useState('')

    useEffect(() => {
        axios.get(`https://localhost:7126/api/Equities/Equities`)
            .then(res => {
                console.log(res.data)
            })
            .catch(error => {
                console.log(error.message)
            })
    }, [])

    const deleteBtnHandler = (event) => {
        axios.delete(`https://localhost:7126/api/Equities/Delete/${id}`)
            .then(res => {
                console.log(res)

                setMsg(`Equity ID: ${id} Deleted S`)
            })
            .catch(err => {
                console.log(err)
            })

        event.preventDefault();
    }

  return (
    <div>
        <h2>Delete Equity</h2>
        <form onSubmit={deleteBtnHandler}>
            <label>Enter SecurityID: </label>
            <input type='text' value={id} onChange={(event) => setId(event.target.value)} placeholder='Enter SecurityID'></input>
            <button type='submit'>Delete Equity</button>

            <h2>{msg}</h2>
        </form>
    </div>
  )
}

export default DeleteEquity
